import React from 'react'; 
import Afternav from "../Coponent/nav_after";
import Avatar from './../Coponent/uploadAvatar';



class profile extends React.Component{
    constructor(props){
        super(props);
        this.state={
            mydata:''
        }
    }

    getData(){
        fetch('http://127.0.0.1:8080/v2/user/info?uid=01',{
            method:'GET'
        }).then(res => res.json()).then(
            data=>{
                this.setState({mydata:data})
            }
        )
    }
            
    componentWillMount(){
        this.getData();
    }
